import React, { Component } from 'react';

export class Searchbar extends Component {
  render() {
    return (
      <div>
        <input onChange={e => console.log(e.target.value)} type='text' />
        <ul>
          {this.props.buildings.map(building => (
            <li>{building.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Searchbar;
